INSERT INTO `detalle_reporte` (`id`, `evidencia`, `observaciones`, `id_tema`, `id_ambito`, `id_puntaje`, `id_encabezado`) VALUES
(76, 'Solo se ha identificado los puntos de interes del parque, se han trabajo nuevos bocetos, material de divulgación pero no esta actualizado (hay que hacer un nuevo tiraje).', 'Gestionar recursos para el nuevo tiraje de materiales de comunicación y divulgación, dirigido a la comunidad y turistas.', 4, 6, 18, 22),
(77, 'El COAL coordina con alcaldias, PNC, entes financiadores (FdA, PRISMA, FIAES, PNUD), OSC (Foro del Agua).\r\nSe hace planificación del año y se revisa el plan.', 'Que se requiere hacer la operatividad de los instrumentos (Planes, reglamento interno) y la dinamización de la junta directiva.', 5, 6, 25, 22),
(79, 'En los 9 proyectos ejecutados en el ANP se incluyen procesos de capacitación, talleres y giras educativas con beneficiarios productores/as (población adulta) sobre protección de bosques e implementación de acciones sostenibles.\r\nNo se realizan acciones de sensibilización/educación en centros escolares.\r\nEn el plan de adaptación a CC municipal que construye la alcaldia junto con UNES han incluido un programa de capacitación.\r\nA traves de los guias se hacen procesos de sensibilización y demostración con estudiantes universitarios, turistas que visitan el parque. El centro de interpretación es un medio que permite hacer sensibilización.', 'Ampliar el grupo meta de los procesos educativos a centros escolares.\r\nGenerar más información y material educativo, visual principalmente para apoyar los procesos educativos.\r\nAplicar metodologías efectiva para niñez (cines ambientales, titeres, tours, etc).', 23, 6, 116, 22),
(80, 'Hay sectores zonificados los cuales no se han intervenido.', 'Es necesario ampliar los accesos principalmente para las amenazas como indicendios forestales.', 7, 7, 34, 22),
(82, 'Se cuenta con una computadora, impresora, camara y una tablet, GPS, cocina, equipamiento (Tacuba).\r\nSan benito tiene equipamiento contra incendio, oficinas, dos computadoras, dron, GPS, camara fotografica, camaras trampa, piochas, palas, equipamiento (San Benito).\r\nEquipamiento contra incendio, oficina, GPS, piochas, palas (SFM)\r\nPalas, piochas, asadones, motocierras, equipo dañado, equipo de alojamiento (La Fincona).', 'Adquirir para Tacuba equipamiento contra incendio.\r\nCapacitar brigadas contraincendios.', 9, 7, 44, 22),
(83, 'Hay una planta solar en La Fincona pero no hay bateria.\r\nHubo un mantenimiento a la base de comunicación.', 'Compromiso por parte del Estado y co-administradores de darle mantenimiento al equipo utilizado para el manejo del área.', 10, 7, 48, 22),
(84, 'En el sector de La Fincona las instalaciones no estan totalmente adecuadas, hay condiciones en mínimas. Falta personal de guardarecursos.\r\nEn San Benito cuentan con estructuras adecuadas.\r\nEn Tacuba, solo se encuentra la oficina donada por la Alcaldía. No se cuenta con caseta dado por condiciones de delincuencia. Este sector habia quedado abandonado despues de la co-administración de Salvanatura, logrando avances en los ultimos años. \r\nHay senderos.\r\nEn San Francisco hay condiciones infraestructurales se encuentran bien.', 'Se debe mejorar las condiciones de La Fincona y Tacuba.', 11, 7, 55, 22),
(85, 'En San Benito hay reparaciones, hay una persona que se encarga en las reparaciones.\r\nEn San Francisco Menendez, hay reparaciones.\r\nTacuba en un 25%', 'Continuar los esfuerzos de mantenimiento.', 12, 7, 59, 22),
(86, 'En San Benito hay rotulación en todos los sectores.\r\nEn La Fincona la rotulación es reciente pero hay daños por personas que no estan de acuerdo con la rotulación.\r\nEn San Francisco Menendez hay rotulación pero se han dañado algunos, hay rotulación no instalada.\r\nEn Tacuba hay rotulación reciente pero dañada por vandalismo. En el sector de La Campana no hay rotulación.', 'En La Fincona se necesita mayor rotulación, con mayor enfasis en los sectores externos.\r\nEs necesario complementar los otros sectores.', 13, 7, 65, 22),
(87, 'En San Benito, hay guías en el sector.\r\nEn SFM, hay un grupo de guías. \r\nHay co-manejadoras: ACEPROS, Asociación Fuente de Vida, Alcaldia Tacuba.\r\nEn El Corozo, es minimo.\r\nEn Tacuba, hay guías.\r\nHay organización para algunas actividades como limpieza, respuesta de incendios.', 'Reforzar el voluntariado en algunos sectores.', 14, 7, 70, 22),
(88, 'Hay plan de manejo vigente a 2022.\r\nHay un plan operativo.', 'Actualizar el plan de manejo 2022.\r\nActualizar POA.', 15, 7, 75, 22),
(90, 'Parte del equipo de guardarecursos son parte de las comisiones municipales de protección civil.\r\nHay un plan municipal de protección civil.\r\nHay coordinación y apoyo entre la municipalidad y los guardarecursos, dependiendo de la zona.\r\nSe implementan acciones durante la epoca seca, se monitorean sectores.\r\nHay brigadas contraincendios conformadas entre guardarecursos y comunidad, se activan según emergencia.\r\nDentro del grupo de COAL se difunde información de la DGOA.', 'Equipamiento para incendios.\r\nContinuar con las brigadas contraincendios. Crear nuevas brigadas.\r\nFortalecimiento de capacidades como curso de bombero forestal.\r\nContinuar la relacion con las CMPC.', 17, 7, 84, 22),
(91, 'planes semanales de patrullaje, coordinacion con policia y fiscalia, vigilancia, realizan procedimiento de capturas y denuncias, inspecciones para autorizaciones o delitos ambientales, preventiva, hay rotulación normativa visible, monitoreo de fauna. Existe zonificación en el parque (uso público, protección) dentro del plan de manejo.\r\nEn el sector campana no hay acciones de protección.', 'Fortalecer los procesos de vigilancia y protección en La Campana.', 18, 8, 90, 22),
(92, 'El parque tiene 25 inmuebles.\r\nEl 90% esta delimitado. Los guardarecursos conocen sus limites.', 'Continuar los procesos de delimitación y trasnferencia, por lo menos de Monte Hermoso.', 19, 8, 95, 22),
(93, 'Se cuenta con herramientas como GPS, Tablets, camaras trampas que permiten monitorear mamiferos.\r\nSe implementan acciones conforme a taxones para ver aumento o disminución de ciertas especies.\r\nSe cuenta de manera digital y en el lado de San Benito se encuentran.\r\nEn La Fincona no hay monitoreo.\r\nHay estudios de flora, fauna.\r\nSe he hecho un levantamiento donde realizar monitoreos de fauna.', 'Sistematización de la información.\r\nContinuar con estudios de especies de interes del parque.', 24, 8, 121, 22),
(94, 'Avanzar en la documentación digital.', 'La información esta ubicada en San Benito sin embargo no esta digitalziada.', 20, 8, 99, 22),
(95, 'La Fincona: Hay un aporte del MARN, hay presupuesto y otro de proyectos.\r\nTacuba: Hay proyectos (Minimo).\r\nSan Francisco: Hay proyectos y recursos del MARN.\r\nSan Benito: hay proyectos y hay financiamiento del MARN.', 'Gestionar más recursos para las inversiones dentro del parque.', 21, 10, 106, 22),
(96, 'San Benito: Disponen de un pliego tarifario.\r\nTacuba: No tienen mecanismo de auto gestión de fondos.\r\nSFM:  Disponen de un pliego tarifario.\r\nLa Fincona: No tienen mecanismo de auto financiamiento.', 'Implementar los pliegos tarifarios en los sectores de Tacuba y La Fincona.\r\nInvertir en infraestructura que promueva el turismo.', 22, 10, 110, 22),
