INSERT INTO `ramsar` (`id_ramsar`, `codigo`, `nombre`, `latitud`, `longitud`, `area`, `descripcion`, `ficha_tecnica`) VALUES
(1, '1592', 'Cerron Grande', 13.978304, -89.051960, 610116489.207000, 'Dentro del embalse han quedado numerosas isletas cubiertas de escasa vegetación arbustiva o boscosa. El suave relieve de la zona y las fluctuaciones del nivel del agua generan abundantes playones y áreas limosas semi-inundadas que sirven como hábitat para numerosos invertebrados y vertebrados acuáticos. Al suroeste del humedal existe una pequeña laguneta estacional (Laguna de Colima) cuyo origen es independiente del embalse. No existen otros tipos de humedales incluidos en el sitio propuesto, aunque sí hay tres parches de bosque tropical seco de pequeño a mediano tamaño. El área provee bienes y servicios ambientales de importancia nacional, como son la producción pesquera e hidroeléctrica, la depuración de aguas y el control de inundaciones. El sitio sirve anualmente como lugar de alimentación, cría y descanso de varios miles de aves acuáticas, tanto residentes como migratorias. En este lugar se han registrado los mayores números poblacionales de anátidas del país.', ''),
(2, '2207', 'Barra de Santiago', 13.693985, -90.012129, 115191546.990000, 'Complejo Barra de Santiago. El sitio contiene un área representativa de los manglares de la seca región ecológica del Norte del Pacífico de América Central y una palmera (Brahea salvadorensis) pantano representante de un ecosistema específico para la ecorregión de bosque seco tropical mesoamericano. Es compatible con numerosas especies amenazadas o en peligro de extinción. Entre ellas se encuentran cuatro especies de tortugas marinas (Eretmochelys imbricata, Lepidochelys olivacea, Dermochelys coriacea y Chelonia mydas) y otras especies gravemente amenazadas por su valor de intercambio comercial, como el loro de nuca amarilla (Amazona auropalliata). Los manglares también soportan el 75% de la fauna costera de importancia comercial en El Salvador. Muchas de estas especies, como los camarones de la familia Penaeidae, dependen de los manglares como zonas de alimentación, desove y cría. El sitio es importante para las comunidades locales, ya que dependen de la pesca artesanal para su subsistencia. Está amenazada por la urbanización no regulada, el sobrepastoreo, el crecimiento de la caña de azúcar y la creciente demanda de madera para la construcción, ya que estos han causado la deforestación, los cambios en la hidrología de la zona y la contaminación. Sitio Ramsar No. 2207. más reciente información RIS: 2013.', ''),
(3, '1935', 'Complejo Jaltepeque', 13.318440, -88.917831, 493650721.515000, 'El Complejo Jaltepeque constituye la segunda extensión de agua salobre y bosque salado de El Salvador, se encuentra limitado geográficamente en el occidente por la cuenca baja del Río Jiboa y en el extremo oriental por la cuenca baja del Río Lempa que ejerce el papel divisorio entre el Complejo Jaltepeque y el Sitio Ramsar de la Bahía de Jiquilisco. Se constituye por diversas sub unidades paisajísticas entre las cuales se contemplan numerosos humedales estacionales y permanentes tales como Escuintla (a ser declarada área natural protegida), pantanos de agua dulce del área natural protegida El Astillero, manglares del Estero de Jaltepeque, barras de arena y playas representadas en la playa Costa del Sol, un numeroso conjunto de islas de diverso tamaño, un complejo lagunar de agua dulce y bosques estacionalmente saturados conectados con el manglar del Estero de Jaltepeque. Dos islas (La Calzada y Tasajera) presentan potencial para el proceso de incorporación al sistema nacional de áreas naturales protegidas. Constituye uno de los hábitats de mayor importancia dada a la alta biodiversidad de especies de fauna y flora incluyendo especies en peligro de extinción local. La isla de Los Pájaros es una de las unidades paisajísticas que destaca por ser un sitio de anidación para algunas aves marino costeras del país y por ser sitio de refugio para aves migratorias que viajan desde el Norte. En su conjunto, el Humedal y la zona costera de Jiquilisco cumplen una función muy importante dentro del contexto del corredor biológico mesoamericano (constituye el punto medio entre las grandes zonas de manglares de Guatemala y el Golfo de Fonseca), a la vez que posee importancia en la prevención de catástrofes (inundaciones, avenidas/riadas, terremotos) y de control de la erosión y fijación de suelo. Los aprovechamientos más relevantes son la extracción pesquera, de mariscos, producción salinera, ganadería, caña de azúcar y plantaciones de coco.', ''),
(4, '1586', 'Bahia de Jiquilisco', 13.233572, -88.552192, 633675329.313000, 'La Bahía de Jiquilisco constituye la mayor extensión de agua salobre y bosque salado de El Salvador, formada por numerosos esteros y canales, barras de arena y playas, un numeroso conjunto de islas de diverso tamaño, un complejo lagunar de agua dulce y bosques estacionalmente saturados conectados con el manglar. Constituye el hábitat de la gran mayoría de aves marino-costeras del país, así como el único sitio de anidación para algunas de ellas (Ref. 11, 31, 38). Se han identificado especies de fauna en peligro de extinción local. Cumple una función muy importante como prevención de catástrofes (avenidas, terremotos) y de control de la erosión y fijación de suelo. Los aprovechamientos más relevantes son el pesquero, marisquero, camaronero-salinero, ganadería y plantaciones de coco. Existe también un aprovechamiento turístico (baño en playas, paseos lancha).', ''),
(5, '970', 'Laguna El Jocotal', 13.331066, -88.247275, 42790240.887400, 'El humedal área natural protegida Laguna del Jocotal se ha ampliado en su parte norte, incluyendo  las lavas del volcán de San Miguel que está asociada con la infiltración de agua a la Laguna. En su parte media se encuentra la Laguna del Jocotal y al sur se han agregado lagunas estacionales y permanentes, así como un tramo del rio Grande de San Miguel. Al este y el oeste se encuentran pastizales y cultivos de caña de azúcar. Además de incluir las el volcán Chaparratique conformado por la zona de contacto de las coladas de lava, matorrales, vegetación primaria hasta 400 m de altura. La vegetación existente asociada a la Laguna San Juan incluye: tulares (Phragmites australis y Typha dominguensis), plantas flotantes como, el “lirio de agua” (Eichornia crassipes), lechuga de agua” (Pistia stratioides), oreja de ratón (Salvinia auriculata), lentejita de pato (Lemna aequinoctialis), corazón de agua (Nymphoides indica), flor de loto (Nympha ampla), plantas emergentes como: tristra (Eleocharis elegans), molinillo (Torulinium odoratum), plantas sumergidas: atrapa moscas (Utricularia foliosa) y pastizales. La vegetación arbórea en los alrededores de este humedal se encuentran: \"Almendro de río\" (Andira inermis), \"morro\" (Crescentia alata), \"mangollano\" (Pithecellobium dulce) \"guayabo\" (Psidium guajava), \"aguijiote\" (Eryhtrina glauca).', ''),
(6, '0', 'Laguna de San Juan', 13.372174, -88.185171, 2000281.303830, '', ''),
(7, '1899', 'Laguna de Olomega', 13.306148, -88.057346, 75917568.118000, 'La laguna de Olomega es el mayor cuerpo de agua dulce de la planicie costera. Este gran cuerpo de agua y los humedales que la rodean se sitúan en una llanura que limita al sur con los acantilados de la cordillera de Jucuarán y al noroeste con el río Grande de San Miguel. El núcleo del humedal está compuesto por un espejo de agua de superficie variable pero que habitualmente ocupa una superficie estimada de 2,556.6 ha con una profundidad media de 2.9 metros y en cuyo interior aparecen las islas de Olomega y Olomeguita, junto con algunos pequeños islotes ubicados en el sector sudoriental de la laguna. En algunos meses de la estación lluviosa, la laguna recibe las aguas del río Grande de San Miguel, las cuales alimentan y drenan la laguna. En el interior de la laguna se crean grandes bancos flotantes de la planta invasora Eichornia crassipes que contribuyen a la eutrofización de la laguna y dificultan el transporte acuático. Esta laguna sirve como área de alimentación y descanso de importantes concentraciones de aves acuáticas migratorias, entre las que destacan hasta ocho especies de anátidas. Al norte y especialmente al noreste de la laguna aparece una extensión considerable de pantanos herbáceos conectados más al norte con un parche de bosque estacionalmente saturado, conocido como La Chiricana, que representa uno de los últimos relictos de uno de los tipos de vegetación más amenazados del país. Los principales núcleos humanos se sitúan sobre las orillas de la ribera sur y al oriente de la laguna.', 'SV1899RIS.pdf'),
(8, '1924', 'Complejo de Guija', 14.261006, -89.504085, 102018302.681000, 'El Complejo Güija abarca las lagunas de Metapán, Clara, Verde, Teconalá y el lago de Güija.12 Este complejo lagunar incluye los volcanes San Diego, Vega de la Caña, Masatepeque y El Tule. Por la parte Norte confluyen los ríos Ostúa y Angue que arrastran diversos materiales al lago de Güija que presenta una superficie de 32 km2 (3,200 ha). Este lago se formó por diversas erupciones de los cerros antes mencionados. Casi no existe vegetación hidrófila, aunque presenta importantes zonas inundables que se utilizan para pastizales y cultivos de hortalizas. Presenta una profundidad máxima aproximada de 30 metros durante la estación lluviosa. Presenta rocas volcánicas en gran parte de su orilla. El lago drena hacia el río El Guajoyo a través del río “El Desagüe”, el cual es alimentado por un proceso de generación de energía eléctrica por medio de la presa “Central Hidroeléctrica Guajoyo” ', '');
